import React, { useState, useEffect } from "react";
import { useLocation, useNavigate } from "react-router-dom"; // useLocation to get passed state
import { updateKnittingDetails } from "../API/SampleApi"; // Assuming you have an API to update data

const UpdateKnittingRecord = () => {
  const location = useLocation();
  const navigate = useNavigate();
  const { RSN, knittingData } = location.state || {};

  // Debugging log for knittingData
  console.log("Knitting Data:", knittingData);

  const [updatedData, setUpdatedData] = useState(knittingData || {});
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");
  const [successMessage, setSuccessMessage] = useState("");

  useEffect(() => {
    if (!knittingData) {
      setError("No knitting data available.");
    }
  }, [knittingData]);

  // Handle input changes
  const handleInputChange = (e, field, key) => {
    const { name, value } = e.target;
    setUpdatedData((prevData) => ({
      ...prevData,
      [field]: {
        ...prevData[field],
        [key]: value,
      },
    }));
  };

  // Handle form submission
  const handleSubmit = async (e) => {
    e.preventDefault();

    if (!updatedData) {
      setError("No data to update.");
      return;
    }

    setLoading(true);
    try {
      const response = await updateKnittingDetails(RSN, updatedData);
      console.log("Response:", response);  // Log response for debugging
      setSuccessMessage(response.message);
      setError("");
    } catch (err) {
      console.error("Error:", err);  // Log error for debugging
      setError("Failed to update knitting details.");
      setSuccessMessage("");
    } finally {
      setLoading(false);
    }

    navigate(`/show-sample/${RSN}`, { state: { RSN } });
  };

  if (loading) return <p>Loading...</p>;

  // Render table fields
  const renderTable = () => {
    return Object.entries(updatedData).map(([field, values]) => {
      if (typeof values === "object" && values !== null) {
        return (
          <tr key={field}>
            <td>{field}</td>
            <td>
              <input
                type="number"
                name="Weight"
                value={values.Weight || ""}
                onChange={(e) => handleInputChange(e, field, "Weight")}
              />
            </td>
            <td>
              <input
                type="number"
                name="Time"
                value={values.Time || ""}
                onChange={(e) => handleInputChange(e, field, "Time")}
              />
            </td>
            <td>
              <input
                type="number"
                name="MachineNo"
                value={values.MachineNo || ""}
                onChange={(e) => handleInputChange(e, field, "MachineNo")}
              />
            </td>
          </tr>
        );
      }
      return null;
    });
  };

  return (
    <div>
      <h1>Update Knitting Details for RSN: {RSN}</h1>
      {error && <p style={{ color: "red" }}>{error}</p>}
      {successMessage && <p style={{ color: "green" }}>{successMessage}</p>}

      <form onSubmit={handleSubmit}>
        <table border="1" style={{ width: "100%", marginTop: "20px" }}>
          <thead>
            <tr>
              <th>Field</th>
              <th>Weight</th>
              <th>Time</th>
              <th>Machine No</th>
            </tr>
          </thead>
          <tbody>{renderTable()}</tbody>
        </table>

        <div style={{ marginTop: "20px" }}>
          <button type="submit" disabled={loading}>
            {loading ? "Updating..." : "Update Record"}
          </button>
        </div>
      </form>
    </div>
  );
};

export default UpdateKnittingRecord;
